import axios from "axios";
import { useEffect } from 'react';
import { useState } from 'react';

export default function Post() {

  const [posts, setposts] = useState([]);

  useEffect(() => {
    if(!posts.length){
     return ;
    }
     axios.get("/post")
    .then((res)=>setposts(res.data))
    .catch((err)=>console.log(err));

    console.log(posts);

  }, [])
  

  return (
    <div>
        PAGE POST
    </div>
  )
}
